import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Schedule from './pages/Schedule';
import Leaderboard from './pages/Leaderboard';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Schedule />
        </Route>
        <Route path="/Schedule">
          <Schedule />
        </Route>
        <Route path="/Leaderboard">
          <Leaderboard />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
